 ff7 fs2 fc0 sc0 ls0 ws0">Group name / Proponents:</div><div class="t m0 x1c hf y29 ff7 fs2 fc0 sc0 ls0 ws0">Men at Work</div></div><div class="c x8 y2a w8 h12"><div class="t m0 x1c hf y23 ff7 fs2 fc0 sc0 ls0 ws0">Date of preparation: October 8, 2020</div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
